import React, { useEffect, useState } from 'react'
import '../styles/Main.css'
import useScreenType from 'react-screentype-hook';
import axios from 'axios';
import iconMap from '../icon-map.json';
import htmlPerser from 'html-react-parser';
import appProp from '../application';

function Main(props) {

    const screenType = useScreenType();
    const [menuList, setMenuList] = useState();
    const [titleCardContactList, setTitleCardContactList] = useState();
    const [titleCardLinkList, setTitleCardLinkList] = useState();
    const [titleCardName, setTitleCardName] = useState();


    const getMenuList = async (email) => {
        if (email !== undefined) {
            const response = await axios.get(appProp.service_base_url + '/getMenus?email=' + email);
            setMenuList(response.data);
        }
    }

    const getTitleCardContactList = async (email) => {
        if (email !== undefined) {
            const response = await axios.get(appProp.service_base_url + '/getContacts?email=' + email);
            setTitleCardContactList(response.data);
        }
    }

    const getTitleCardLinkList = async (email) => {
        if (email !== undefined) {
            const response = await axios.get(appProp.service_base_url + '/getLinks?email=' + email);
            setTitleCardLinkList(response.data);
        }
    }

    const getTitleCardName = async (email) => {
        if (email !== undefined) {
            const response = await axios.get(appProp.service_base_url + '/getTitleCardInfo?email=' + email);
            setTitleCardName(response.data);
            props.setHeaderProfilePic('data:image/jpeg;base64,' + titleCardName.image);
        }
    }

    useEffect(() => {
        const params = new URLSearchParams(window.location.search);
        getMenuList(params.get('email'));
        getTitleCardContactList(params.get('email'));
        getTitleCardLinkList(params.get('email'));
        getTitleCardName(params.get('email'));
    }, []);

    return (
        <div className='main'>
            <div className='content-card'>
                {
                    (props.state.isTitleOpen && screenType.isMobile) ||
                        (props.state.isTitleOpen && screenType.isTablet) ||
                        screenType.isDesktop || screenType.isLargeDesktop ?
                        <div className='title-card card'>
                            {titleCardName !== undefined ?
                                <div className='section'>
                                    <img className='profile-pic' src={'data:image/jpeg;base64,' + titleCardName.image} alt='profile-pic'></img>
                                    <span>{titleCardName.name}</span>
                                    <span>{titleCardName.email}</span>
                                </div> : <></>
                            }
                            <ul>
                                {
                                    titleCardLinkList !== undefined ?
                                        titleCardLinkList.map((menu) => {
                                            return (
                                                <li key={0}>
                                                    <div className='list-item'>
                                                        <div className='icon'>
                                                            {htmlPerser(iconMap['Link'])}
                                                        </div>
                                                        <div className='content'>
                                                            <span>{menu.link}</span>
                                                        </div>
                                                    </div>
                                                </li>
                                            )
                                        }) : <></>
                                }

                                {
                                    titleCardContactList !== undefined ?
                                        titleCardContactList.phoneNos.map((menu, index) => {
                                            return (
                                                <li key={index}>
                                                    <div className='list-item'>
                                                        <div className='icon'>
                                                            {htmlPerser(iconMap['Phone'])}
                                                        </div>
                                                        <div className='content'>
                                                            <span>{menu.phoneNo}</span>
                                                        </div>
                                                    </div>
                                                </li>
                                            )
                                        }) : <></>
                                }

                                {
                                    titleCardContactList !== undefined ?
                                        titleCardContactList.addresses.map((menu, index) => {
                                            return (
                                                <li key={index}>
                                                    <div className='list-item'>
                                                        <div className='icon'>
                                                            {htmlPerser(iconMap['Address'])}
                                                        </div>
                                                        <div className='content'>
                                                            <span>{menu.address}</span>
                                                        </div>
                                                    </div>
                                                </li>
                                            )
                                        }) : <></>
                                }
                            </ul>
                        </div>
                        : <></>
                }

                {
                    (props.state.isMenuOpen && screenType.isMobile) ||
                        (props.state.isMenuOpen && screenType.isTablet) ||
                        screenType.isDesktop || screenType.isLargeDesktop ?
                        <div className='sub-content-card card'>
                            <ul>
                                {menuList !== undefined ?
                                    menuList.map((menu, index) => {
                                        return (
                                            menu.title !== 'Phone' && menu.title !== 'Address' && menu.title !== 'Link' ?
                                                <li key={index}>
                                                    <div className='list-item'>
                                                        <div className='icon'>
                                                            {htmlPerser(iconMap[menu.title])}
                                                        </div>
                                                        <div className='content'>
                                                            <span>{menu.title}</span>
                                                        </div>
                                                        <div className='select'>
                                                            <svg xmlns='http://www.w3.org/2000/svg' fill='currentColor' className='icon' viewBox='0 0 16 16'>
                                                                <path fillRule='evenodd' d='M4.646 1.646a.5.5 0 0 1 .708 0l6 6a.5.5 0 0 1 0 .708l-6 6a.5.5 0 0 1-.708-.708L10.293 8 4.646 2.354a.5.5 0 0 1 0-.708z' />
                                                            </svg>
                                                        </div>
                                                    </div>
                                                </li>
                                                : <></>)
                                    })
                                    : <></>
                                }

                            </ul>
                        </div>
                        : <></>
                }

                {
                    (!props.state.isTitleOpen && !props.state.isMenuOpen && screenType.isMobile) ||
                        (props.state.isInfoOpen && screenType.isTablet) ||
                        screenType.isDesktop || screenType.isLargeDesktop ?
                        <div className='sub-content-info-card card'>
                            sub content info
                        </div>
                        : <></>
                }
            </div>

        </div>
    )
}

export default Main
